import React from 'react';
import Logo from './logomain.png'
import './NB.css'
import useState from 'react'

export default function NB(props) {
    return (
        <div>
        <div className = "NavBar">
            <a href="/index"><img className = "logo" src={Logo} /></a>
            <a  class="button b-green"><button onClick={() => props.state(false)}>Предложить проект</button></a>
        </div>
        </div>
    );
}
